-- Convert table -> CFrame
local function tableToCFrame(t)
    return CFrame.new(t.x, t.y, t.z) * CFrame.Angles(t.rx, t.ry, t.rz)
end

-- GUI
local screenGui = Instance.new("ScreenGui")
screenGui.Parent = player:WaitForChild("PlayerGui")

local playButton = Instance.new("TextButton")
playButton.Size = UDim2.new(0,150,0,50)
playButton.Position = UDim2.new(0,20,0,20)
playButton.Text = "Play Record"
playButton.Parent = screenGui

-- State
local isPlaying = false
local playbackTask = nil

-- Fungsi play / stop
local function playRecord()
    if isPlaying then
        -- Stop playback
        isPlaying = false
        playButton.Text = "Play Record"
        print("Playback stopped")
        return
    end

    -- Mulai playback
    isPlaying = true
    playButton.Text = "Stop Record"
    print("Playback started")
    
    playbackTask = task.spawn(function()
        for _, t in ipairs(record) do
            if not isPlaying then break end
            hrp.CFrame = tableToCFrame(t)
            task.wait(0.1) -- interval sesuai rekaman
        end
        isPlaying = false
        playButton.Text = "Play Record"
        print("Playback ended")
    end)
end

